import React, { useState, useCallback } from 'react';
import { useNavigate } from 'react-router-dom';
import Cropper from 'react-easy-crop';
import mangoLogo from '../../assets/Logo_white.png';
import userProfileImg from '../../assets/profile.jpg';

const CropImage = () => {
  const [selectedImage, setSelectedImage] = useState(null);
  const [crop, setCrop] = useState({ x: 0, y: 0 });
  const [zoom, setZoom] = useState(1);
  const navigate = useNavigate();

  const handleNavigation = (path) => navigate(path);

  const handleFileChange = (event) => {
    const file = event.target.files[0];
    if (file && /\.(jpg|jpeg|png)$/i.test(file.name)) {
      setSelectedImage(URL.createObjectURL(file));
    } else {
      alert('Only .jpg, .jpeg, and .png files are allowed.');
    }
  };

  const onCropComplete = useCallback((croppedArea, croppedAreaPixels) => {
    console.log(croppedArea, croppedAreaPixels);
  }, []);

  const handleUpload = () => {
    alert('Image cropped and ready for upload!');
  };

  return (
    <div className="container">
      <nav className="navbar">
        <div className="navbar-brand">
          <img src={mangoLogo} alt="Mango Logo" className="logo" />
        </div>
        <div className="navbar-links">
          <button className="link" onClick={() => handleNavigation('/dashboardpage')}>Dashboard</button>
          <button className="link" onClick={() => handleNavigation('/bruiseareacalculation')}>Bruised Area Calculation</button>
          <button className="link" onClick={() => handleNavigation('/featureanalysis')}>Feature Analysis</button>
          <button className="link" onClick={() => handleNavigation('/aboutuspage')}>About Us</button>
          <button className="link" onClick={() => handleNavigation('/contactuspage')}>Contact Us</button>
        </div>
        <div className="navbar-profile">
          <img src={userProfileImg} alt="User Profile" className="profile-pic" />
        </div>
      </nav>

      <div className="content">
        <h1 className="title">Crop Image</h1>
        <p className="description">Transform your images into the perfect size in seconds.</p>
        {!selectedImage ? (
          <div className="file-dropzone">
            <input type="file" className="file-input" onChange={handleFileChange} accept=".jpg,.jpeg,.png" />
            <button className="upload-btn">Upload Image</button>
          </div>
        ) : (
          <div className="crop-container">
            <Cropper
              image={selectedImage}
              crop={crop}
              zoom={zoom}
              aspect={4 / 3}
              onCropChange={setCrop}
              onZoomChange={setZoom}
              onCropComplete={onCropComplete}
            />
            <input type="range" value={zoom} min={1} max={3} step={0.1} onChange={(e) => setZoom(Number(e.target.value))} />
          </div>
        )}

        <div className="actions">
          <button className="btn back-btn" onClick={() => handleNavigation('/dashboardpage')}>Cancel</button>
          <button className="btn upload-btn" onClick={handleUpload}>Update</button>
        </div>
      </div>

      <footer className="footer">
        <p className="address">Mae Fah Luang University 333 Moo 1, Thasud, Muang, Chiang Rai 57100</p>
      </footer>
    </div>
  );
};

export default CropImage;
